import React, { useState } from "react";


export const Form = () => {
  const [city,setCity] = useState();
  return (
    <form>
      <input type="text" name="city" placeholder="都市名" onChange={setCity} />
      <button type="submit">Get Weather</button>
    </form>
  );
};

export default Form;
